import "./Autok.css";
import React from "react";


class Autok extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        autok: []
      };
    }
  
    componentDidMount() {
      fetch("http://localhost:5000/api/auto/autok")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              autok: result
            });
          },
          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }

    render() {
      const { error, isLoaded, autok } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        
        return (
          <form className="pageautok" action="http://localhost:5000/api/rendeles/feltolt"  method="POST">
            
              {autok.map(auto => (
                
              <div className="auto" key={auto._id}>
               <img className="kep" src={require("../../public/kepek/" + auto.kep)} alt={auto.kep} /><br />
               <label name="marka" value={auto.marka} >Marka: {auto.marka}</label><br />
               <label name="uzemanyag" value={auto.elektromos} >Uzemanyag: {auto.elektromos}</label><br />
               /*<label name="ar" value={auto.ar}>√Åra: {auto.ar} ft.</label>  
               <input type="text" name="ar"  value={auto.ar}  disabled /> <br />
               <select name="szin" id="szin">szin
               <option value="benzin">fekete</option>
               <option value="benzin">szurke</option>
               <option value="benzin">kek</option>
               <option value="benzin">zold</option>
               <option value="benzin">piros</option>
               </select>
                <br /> <br />
                <input type="email" name="rendeloemail" placeholder="email..."/> <br /><br />
               <input type="text" name="szemelyiszam" placeholder="szemelyi szam..."/> <br /><br />
               <button type="submit">Rendeles</button>
              </div>
           ))}
          </form>
          
        ); 
      }
    }
  }
export default Autok;
